import React, { useEffect, useMemo, useRef, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import '../../index.css';
import { useDispatch, useSelector } from "react-redux";
import Cookies from "js-cookie";
import Pagination from "../Pagination"
import useDebounce from "../../hooks/useDebounce";
import SearchAndExport from "../SearchAndExport";
import { getStartUpDetails } from "../../store/slice/startUpListSlice";
import { SEARCH_DELAY } from "../../app.config";
import { setLoader } from "../../store/slice/masterSlice";
import AddStartupModal from "../AddStartupModal";

const Dashboard = () => {
    const navigate = useNavigate();
    const [page, setPage] = useState(1);
    const dispatch = useDispatch();
    const [search, setSearch] = useState("");
    const debounce = useDebounce(search, SEARCH_DELAY);
    const { StartUpList: { data: StartUpList } } = useSelector((state) => state.startUp);
    const handlePageChange = (newPage) => { setPage(newPage) };
    const [showModal, setShowModal] = useState(false);
    console.log(StartUpList, "----------------")
    const handleStartUpAPI = () => {
        dispatch(setLoader(true));
        let submitData = {
            search: debounce,
            page: page
        }
        dispatch(getStartUpDetails(submitData));
        dispatch(setLoader(false));
    };

    const startUpListData = useMemo(() => {
        return StartUpList?.map((item, index) => (
            <>
                <tr key={index}>
                    <td>{index + 1}</td>
                    <td>{item?.startup_name}</td>
                    <td>
                        <a className="text-reset fs-18 cursor_pointer" onClick={() => navigate(`/manage_properies/view-property/${item?.property_id}`, { state: { propertyData: item } })}> <i className="ri-eye-line"></i></a>
                        <a className="text-reset fs-18 m-1 cursor_pointer" > <i
                            className="ri-edit-line"></i></a>
                        <a className="text-reset fs-18 cursor_pointer" > <i className="ri-delete-bin-6-line"></i></a>
                    </td>
                </tr>
            </>
        ))
    }, [StartUpList])

    useEffect(() => {
        handleStartUpAPI();
    }, [page, debounce]);

    return (
        <main className="page_wrepper">
            <div className="content">
                <div className="container-fluid">
                    <div className="card rounded-3">
                        <div className="card-body">
                            <div className="rounded-3 mb-3">
                                {/* Pass setShowModal to SearchAndExport */}
                                <SearchAndExport searchFieldName="Start up name" setSearch={setSearch} setShowModal={setShowModal} />
                            </div>
                            <div className="responsive-table-plugin">
                                <div className="table-rep-plugin">
                                    <div className="table-responsive" data-pattern="priority-columns">
                                        {StartUpList?.length > 0 ? (
                                            <table className="table table-hover table-centered mb-0">
                                                <thead>
                                                    <tr>
                                                        <th>Id</th>
                                                        <th>StartUp Name</th>
                                                        <th>Incorporation Date</th>
                                                        <th>State</th>
                                                        <th>Phone Number</th>
                                                        <th>Action</th>
                                                    </tr>
                                                </thead>
                                                <tbody>
                                                    {/* Render startup list */}
                                                    {startUpListData}
                                                </tbody>
                                            </table>
                                        ) : (
                                            <p className="text-center">No Data Found</p>
                                        )}
                                    </div>

                                    {/* Pagination */}
                                    {StartUpList?.length > 0 && (
                                        <Pagination
                                            per_page={StartUpList?.per_page}
                                            pageCount={StartUpList[0]?.startup_count}
                                            onPageChange={handlePageChange}
                                            page={page}
                                            lableName="StartUpData"
                                        />
                                    )}
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

            {/* Add Startup Modal */}
            <AddStartupModal showModal={showModal} setShowModal={setShowModal} />
        </main>
    );
}

export default Dashboard;
